import React from "react";
import { Link } from "react-router-dom";

function PlacesPage() {
  return (
    <div>
      <Link to="/account/places/new" className="btn btn-primary my-2">
        &plus, Add new Place
      </Link>
    </div>
  );
}

export default PlacesPage;
